import React from 'react'
import ReactRotatingText from 'react-rotating-text'

export default class Intro extends React.Component {

    render() {

        return(
            <h1>
            <ReactRotatingText items={["iunno", "IDK", "I don&#39t know", "No lo sé", "知りません", "Je ne sais pas", "Ich weiß es nicht", "我不知道", "انا لا اعرف"]} />
        </h1>)
    }
}
